import React from "react";

const PokemonInfoCard = ({ pokemonData, currentSelectedPokemon }) => {
  return (
    <div className="flex border">
      {pokemonData[currentSelectedPokemon].name}
      {pokemonData[currentSelectedPokemon].stats.map((stat) => (
        // <p>{stat.base_stat} </p>
        <div>
          <div className="mx-2">
            {stat.stat.name} :{stat.base_stat}
          </div>
          {/* <div className="mx-2">{stat.base_stat}</div> */}
        </div>
      ))}
    </div>
  );
};

export default PokemonInfoCard;
